import CommonActionType from "../actiontype/common.actiontype";

const initialState = {

}

export default function disabledTaggingReducer(state = initialState, action) {
    switch (action.type) {
        case DisabledTaggingAction.FTR_TAGGING_ENABLED:
            return { ...state, [DisabledTaggingStatus.FTR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.FTR_TAGGING_DISABLED:
            return { ...state, [DisabledTaggingStatus.FTR_TAGGING]: action.payload.status }

        case DisabledTaggingAction.SR_TAGGING_ENABLED:
            return { ...state, [DisabledTaggingStatus.SR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.SR_TAGGING_DISABLED:
            return { ...state, [DisabledTaggingStatus.SR_TAGGING]: action.payload.status }

        case DisabledTaggingAction.BLANK_CALL_TAGGING_ENABLED:
            return { ...state, [DisabledTaggingStatus.BLANK_CALL_TAGGING]: action.payload.status }
        case DisabledTaggingAction.BLANK_CALL_TAGGING_DISABLED:
            return { ...state, [DisabledTaggingStatus.BLANK_CALL_TAGGING]: action.payload.status }

        case DisabledTaggingAction.CALL_DROP_TAGGING_ENABLED:
            return { ...state, [DisabledTaggingStatus.DROP_CALL_TAGGING]: action.payload.status }
        case DisabledTaggingAction.CALL_DROP_TAGGING_DISABLED:
            return { ...state, [DisabledTaggingStatus.DROP_CALL_TAGGING]: action.payload.status }

        case DisabledTaggingAction.CALL_TRANSFER_TAGGING_ENABLED:
            return { ...state, [DisabledTaggingStatus.TRANSFER_FTR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.CALL_TRANSFER_TAGGING_DISABLED:
            return { ...state, [DisabledTaggingStatus.TRANSFER_FTR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.CALL_DROP_SCENARIO_TAGGING_ENABLED:
            return { ...state, [DisabledTaggingStatus.DROP_CALL_SCENARIO_TAGGING]: action.payload.status }
        case DisabledTaggingAction.CALL_DROP_SCENARIO_TAGGING_DISABLED:
            return { ...state, [DisabledTaggingStatus.DROP_CALL_SCENARIO_TAGGING]: action.payload.status }
        case DisabledTaggingAction.SCENARIO_FTR_TAGGING_ENABLED:
            return { ...state, [DisabledTaggingStatus.SCENARIO_FTR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.SCENARIO_FTR_TAGGING_DISABLED:
            return { ...state, [DisabledTaggingStatus.SCENARIO_FTR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.SCENARIO_SR_TAGGING_ENABLED:
            return { ...state, [DisabledTaggingStatus.SCENARIO_SR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.SCENARIO_SR_TAGGING_DISABLED:
            return { ...state, [DisabledTaggingStatus.SCENARIO_SR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.SUB_HEADER_OUTSTANDING_FTR_TAGGING_ENABLED:
            return { ...state, [DisabledTaggingStatus.SUB_HEADER_OUTSTANDING_FTR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.SUB_HEADER_OUTSTANDING_FTR_TAGGING_DISABLED:
            return { ...state, [DisabledTaggingStatus.SUB_HEADER_OUTSTANDING_FTR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.SUB_HEADER_OUTSTANDING_SR_TAGGING_ENABLED:
            return { ...state, [DisabledTaggingStatus.SUB_HEADER_OUTSTANDING_SR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.SUB_HEADER_OUTSTANDING_SR_TAGGING_DISABLED:
            return { ...state, [DisabledTaggingStatus.SUB_HEADER_OUTSTANDING_SR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.BILL_COMPARATOR_FTR_TAGGING_ENABLED:
            return { ...state, [DisabledTaggingStatus.BILL_COMPARATOR_FTR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.BILL_COMPARATOR_FTR_TAGGING_DISABLED:
            return { ...state, [DisabledTaggingStatus.BILL_COMPARATOR_FTR_TAGGING]: action.payload.status }

        case DisabledTaggingAction.PLAN_USAGE_FTR_TAGGING_ENABLED:
            return { ...state, [DisabledTaggingStatus.PLAN_USAGE_FTR_TAGGING]: action.payload.status }
        case DisabledTaggingAction.PLAN_USAGE_FTR_TAGGING_DISABLED:
            return { ...state, [DisabledTaggingStatus.PLAN_USAGE_FTR_TAGGING]: action.payload.status }

        case DisabledTaggingAction.MULTIPLE_DYNAMIC_TAGGING_ENABLED:
            return {
                ...state, [DisabledTaggingStatus.MULTIPLE_DYNAMIC_TAGGING]: { ...state[DisabledTaggingStatus.MULTIPLE_DYNAMIC_TAGGING], [action.payload.multiDynamicTaggingKey]: action.payload.status }
            }
        case DisabledTaggingAction.MULTIPLE_DYNAMIC_TAGGING_DISABLED:
            return {
                ...state, [DisabledTaggingStatus.MULTIPLE_DYNAMIC_TAGGING]: { ...state[DisabledTaggingStatus.MULTIPLE_DYNAMIC_TAGGING], [action.payload.multiDynamicTaggingKey]: action.payload.status }
            }
        // TODO: handle customer change action    
        case CommonActionType.RESET_STATE:
            return { ...state, ...initialState }
        default:
    }

    return state;
}
